style.css:
@-moz-document url-prefix("https://www.roblox.com/") {
.dark-theme .content {
    background-color: #1A1B26;
    color: #fff;
}

.dark-theme {
    background-color: #1A1B26;
    color: #fff;
}

.dark-theme .rbx-header {
    background-color: #16161E;
    border: solid #45454B;
    border-width: 0 0 1px;
}

.dark-theme .rbx-left-col {
    box-shadow: 0 0 8px 0 #16161e69;
    background-color: #16161E;
}

.dark-theme .container-footer {
    background-color: #16161E;
}

.dark-theme .chat-container .chat-main .chat-header {
    background-color: #16161E;
}

.dark-theme .chat-search {
    background-color: #16161E;
    border-color: #16161E;
    color: #16161E;
    border-radius: 8px;
}

.dark-theme .chat-main {
    background-color: #16161E;
    color: #16161E;
}

.dark-theme .dialogs .dialog-container .dialog-body {
    background-color: #16161ed6;
    color: #fff;
}

.dark-theme .dialogs .dialog-container .dialog-header {
    background-color: #16161e;
}

.dark-theme .dialog-container .dialog-input-container .dialog-input {
    background-color: #16161e;
    border-color: hsla(0, 0%, 100%, .2);
    color: #bdbebe;
    border-radius: 8px;
}

.dark-theme .rbx-tab .rbx-tab-heading {
    background-color: #16161e;
    color: #fff;
}

.dark-theme .btn-common-play-game-lg {
    background-color: #16161e;
    border-color: #1A1B26;
    color: #fff;
    border-radius: 8px;
}

.dark-theme .input-field {
    background-color: #16161e;
    border-color: hsla(0, 0%, 100%, .2);
    color: #bdbebe;
    border-radius: 8px;
}

.dark-theme .input-group .input-field {
    background-color: #16161E;
    border-color: hsla(0, 0%, 100%, .2);
    color: #bdbebe;
    border-radius: 8px;
}

.dark-theme .age-rating-details {
    background-color: #16161ed1;
}

.dark-theme .rbx-tab .rbx-tab-heading {
    background-color: #16161E;
    color: #fff;
}

.dark-theme .rbx-tabs-horizontal .rbx-tab.active .rbx-tab-heading {
    color: #fff;
    background-color: #484951;
    box-shadow: inset 0 -4px 0 0 #111117;
}

.avatar-back .thumbnail-2d-container {
    background-color: #16161E;
}

.dark-theme .avatar-back,
.light-theme .avatar-back {
    margin-top: 0;
    margin-left: 0;
    border-radius: 5px;
}

.dark-theme .rbx-tabs-horizontal .nav-tabs {
    background-color: #16161E;
    color: #fff;
}

.dark-theme .rbx-tabs-horizontal #horizontal-tabs .rbx-tab:not(.active) a:not(:hover) {
    background-color: #16161E;
    color: #fff;
    border-radius: 15px
}

.dark-theme .section-content {
    background-color: #16161E;
    color: #fff;
    border-radius: 5px
}

.dark-theme .menu-vertical .menu-option.active {
    color: #fff;
    background-color: #16161E;
    box-shadow: inset 4px 0 0 0 #fff;
}

.dark-theme .menu-vertical {
    background-color: #16161E;
    color: #fff;
}

.dark-theme .container-empty,
.dark-theme .section-content-off {
    background-color: #16161E;
    color: #bdbebe;
    border-radius: 5px
}

.dark-theme .messages .messageDivider.unread {
    background-color: #16161E;
}

.dark-theme .messages .messageDivider {
    background-color: #1A1B26;
    color: #fff;
}

.dark-theme .messages .messageDivider.message-news {
    background-color: #1A1B26;
    color: #fff;
}

.dark-theme .table {
    background-color: #1A1B26;
    color: #fff;
}

.dark-theme .profile-avatar-right .profile-avatar-mask {
    background-color: #1A1B26;
    color: #fff;
}

.dark-theme .layer {
    background-color: #16161E;
}

.dark-theme .slide-switcher .slide-item-container .slide-item-container-right {
    background-color: #16161E;
    color: #fff;
}

.dark-theme .slide-switcher .slide-item-container .slide-item-container-left {
    background-color: #16161E;
}

.dark-theme .thumbnail-2d-container {
    border: 0;
    background-color: #1A1B26;
    border-color: #16161E;
}

.dark-theme .asset-thumb-container {
    background-color: #1A1B26;
    border: 0;
}

#profile-current-wearing-avatar .thumbnail-2d-container {
    width: 100%;
    height: 100%;
    text-align: center;
    background-color: #1A1B26;
    padding-top: 0;
    background-size: 305px;
    background-position: 50%;
}

.dark-theme .avatar-container .avatar-card-image,
.dark-theme .avatar-container img {
    background-color: #1A1B26;
}

.dark-theme .avatar .avatar-card-image {
    background-color: #1A1B26;
}

.dark-theme .avatar-card-container {
    background-color: #16161E;
    color: #fff;
}

.dark-theme .friends-content .avatar-card-content {
    background-color: #16161E;
}

.dark-theme .avatar-card-btns {
    background-color: #16161E;
    color: #fff;
}

.chat-main {
    -webkit-transform: translateZ(0);
    transform: translateZ(0);
    -ms-transform: none;
    position: fixed;
    border-top-right-radius: 4px;
    border-top-left-radius: 4px;
    box-shadow: 0 1px 3px #16161e69;
    bottom: 0;
    right: 6px;
    z-index: 1040;
    width: 280px;
    height: 360px;
}
}
